import React from 'react';

function Form() {

    return (
        <div className = 'formContainer'>
            <form>
                <label>
                    <input 
                        placeholder = 'First and Last Name'>
                    </input>
                </label>
                <label>
                    Email Address:
                    <input
                        placeholder = 'Email Address'>
                    </input>
                </label>

            </form>
         </div>
    )

};

export default Form;
